import CalendarUI from '../components/CalendarUI'
import { useState } from 'react'
import jobs from '../data/jobs'

const Home = () => {
    const [state, setState] = useState(jobs)

    return (
        <>
            <CalendarUI jobs={state} />
        </>
    )
}

export default Home
